q=A.d5(A.b([A.cg(A.b(["Flutter\ub294 \uc790\uccb4 \ub80c\ub354\ub7ec\ub97c \uc0ac\uc6a9\ud558\uae30 \ub54c\ubb38\uc5d0, \uc2a4\ud06c\ub864 \ub3d9\uc791 \uc5ed\uc2dc \ud50c\ub7ab\ud3fc\uc758 \uae30\ubcf8 \ucef4\ud3ec\ub10c\ud2b8\uc640\ub294 \ub3c5\ub9bd\uc801\uc73c\ub85c Flutter \ub0b4\ubd80\uc5d0\uc11c \uc218\ud589\ub429\ub2c8\ub2e4. \uc0ac\uc6a9\uc790\uc758 \uc785\ub825 \uc7a5\uce58\ub294 Flutter \ub7f0\ud0c0\uc784\uc758 \ub9ac\uc2a4\ub108\ub97c \uac70\uccd0, \uc801\uc808\ud55c \uc704\uc82f\uc5d0 \uc785\ub825\uc744 \uc804\ub2ec\ud558\uace0, \uadf8 \uc704\uc82f\uc774 \ubc18\uc751\ud558\ub294 \ubc29\uc2dd\uc785\ub2c8\ub2e4. ","\uc774 \ubc29\uc2dd \uc790\uccb4\ub294 \ubb38\uc81c\ub97c \uc77c\uc73c\ud0a4\uac70\ub098 \uc131\ub2a5\uc5d0 \ubd80\uc815\uc801\uc778 \uc601\ud5a5\uc744 \ubbf8\uce58\ub294 \uac83\uc740 \uc544\ub2c8\uc9c0\ub9cc, \ub9c8\uc6b0\uc2a4 \ud720 \uc2a4\ud06c\ub864 \uc785\ub825\uc744 \uc788\ub294 \uadf8\ub300\ub85c \ubc18\uc601\ud558\uc5ec \uc2a4\ud06c\ub864\uc774 \ubd80\ub4dc\ub7fd\uc9c0 \uc54a\uace0 \ubd88\uc5f0\uc18d\uc801\uc778 \ub290\ub08c\uc744 \uc90d\ub2c8\ub2e4. \uc774\ub7ec\ud55c \ub3d9\uc791\uc740 \ud604\ub300\uc801\uc778 \uc0ac\uc6a9\uc790 \uacbd\ud5d8\uacfc\ub294 \ub2e4\uc18c \ub9de\uc9c0 \uc54a\uae30 \ub54c\ubb38\uc5d0 \uac1c\uc120\uc774 \ud544\uc694\ud588\uc2b5\ub2c8\ub2e4."],n),!1,!1,"\ud50c\ub7ec\ud130\uc758 \uc2a4\ud06c\ub864: \ubb38\uc81c",q),A.cg(A.b(["\uc774 \uc774\uc288\ub294 \uc774\ubbf8 \uc54c\ub824\uc838 \uc788\uc73c\uba70, \ub300\uc751\ud558\ub294 Flutter \ud328\ud0a4\uc9c0\ub4e4\ub3c4 \uc874\uc7ac\ud569\ub2c8\ub2e4. \uc800\uc758 \ud504\ub85c\uc81d\ud2b8\uc5d0 \uc801\uc6a9\ud558\uae30 \uc704\ud574 \uc774 \uc774\uc288\ub97c \ud574\uacb0\ud558\ub294 \ud328\ud0a4\uc9c0 \uc911 \ud558\ub098\uc778 dyn_mouse_scroll\uc744 \uc0ac\uc6a9\ud574 \ubcf4\uc558\uc2b5\ub2c8\ub2e4. dyn_mouse_scroll\uc740 \ub370\uc2a4\ud06c\ud1b1 \ud658\uacbd\uc5d0\uc11c \ub9c8\uc6b0\uc2a4 \ud720\uc5d0 \ub300\ud574 \ubd80\ub4dc\ub7ec\uc6b4 \uc2a4\ud06c\ub864\uc744 \uc81c\uacf5\ud558\uc9c0\ub9cc, \uc6f9 \ud658\uacbd\uc5d0\uc11c\ub294 \ube44\uc815\uc0c1\uc801\uc778 \ub3d9\uc791\uc744 \ubcf4\uc5ec \ud504\ub85c\uc81d\ud2b8\uc5d0 \uc0ac\uc6a9\ud558\uae30\uac00 \uc5b4\ub824\uc6e0\uc2b5\ub2c8\ub2e4. \uacb0\uad6d, \ud574\ub2f9 \ud328\ud0a4\uc9c0\ub97c \uae30\ubc18\uc73c\ub85c \uc2a4\ud06c\ub864 \ub3d9\uc791\uc744 \ubcf4\uc815\ud558\ub294 \uc0c8\ub85c\uc6b4 \ud328\ud0a4\uc9c0\ub97c \ub9cc\ub4e4\uae30\ub85c \ud588\uc2b5\ub2c8\ub2e4.","\uc81c\uac00 \ub9cc\ub4e0 \ud328\ud0a4\uc9c0\ub294 silky_scroll\ub85c, \uc778\ud130\ud398\uc774\uc2a4\ub294 dyn_mouse_scroll\uacfc \uc720\uc0ac\ud558\uc9c0\ub9cc \ub0b4\ubd80 \uad6c\uc870\ub97c \uc644\uc804\ud788 \uc0c8\ub85c \ub9cc\ub4e4\uc5b4 \uc0ac\uc2e4\uc0c1 \ub2e4\ub978 \ud50c\ub7ec\uadf8\uc778\uc774 \ub418\uc5c8\uc2b5\ub2c8\ub2e4. dyn_mouse_scroll\uc758 \ubb38\uc81c\uc810\uc740 \uc704\uc82f \uc790\uccb4\uac00 \uc2a4\ud06c\ub864\uc744 \ubc1b\ub294 \uac83\uc744 \ucc28\ub2e8\ud558\uc9c0 \uc54a\uc544, \ud50c\ub7ec\uadf8\uc778\uc758 \uc2a4\ud06c\ub864 \ubcf4\uc815 \ub3d9\uc791\uc774 \uc704\uc82f\uc758 \uc2a4\ud06c\ub864 \ud2b8\ub9ac\uac70\uc5d0 \uc758\ud574 \ucc28\ub2e8\ub41c\ub2e4\ub294 \uac83\uc774\uc5c8\uc2b5\ub2c8\ub2e4. \uc774\ub85c \uc778\ud574 \ube44\uc815\uc0c1\uc801\uc778 \uc2a4\ud06c\ub864\uc774 \ubc1c\uc0dd\ud588\uae30 \ub54c\ubb38\uc5d0, \uc774\ub97c \ud574\uacb0\ud558\uae30 \uc704\ud574 Flutter\uc758 \uc800\uc218\uc900 \ub3d9\uc791\uc744 \ucee4\uc2a4\ud140\ud588\uc2b5\ub2c8\ub2e4.","\uc2a4\ud06c\ub864 \ub3d9\uc791\uc744 \ucc28\ub2e8\ud558\uae30 \uc704\ud574 \ubcc4\ub3c4\ub85c \ucee4\uc2a4\ud140\ud55c ScrollPositionWithSingleContext\ub97c \ub9cc\ub4e4\uc5c8\uc73c\uba70, \uc774\ub294 \ud130\uce58 \uc778\ud130\ud398\uc774\uc2a4\uc5d0\uc11c\ub294 \uae30\uc874 \ubc29\uc2dd\ub300\ub85c \ub3d9\uc791\ud558\uba74\uc11c \ub9c8\uc6b0\uc2a4 \uc785\ub825\uc5d0\uc11c\ub294 \uc81c\uac00 \ucee4\uc2a4\ud140\ud55c \ub85c\uc9c1\uc73c\ub85c \ub3d9\uc791\ud558\ub3c4\ub85d \ud558\uc5ec \uc704\uc82f\uc758 \uc2a4\ud06c\ub864 \ub3d9\uc791 \uc804\ub2ec\uc744 \ucc28\ub2e8\ud588\uc2b5\ub2c8\ub2e4. \ub610\ud55c, Flutter\uc758 \uc2a4\ud06c\ub864\uc740 \ube0c\ub77c\uc6b0\uc800\uc758 \uc2a4\uc640\uc774\ud504\uc640 \ub3d9\uc791\uc774 \uc911\ucca9\ub418\ub294 \ubb38\uc81c\uac00 \uc788\uc5c8\ub294\ub370, \uc774\ub97c \ud574\uacb0\ud558\uae30 \uc704\ud574 \uc790\ubc14\uc2a4\ud06c\ub9bd\ud2b8 API\ub97c \uc0ac\uc6a9\ud558\uc5ec \uc2a4\ud06c\ub864 \uc911\uc5d0\ub294 \ube0c\ub77c\uc6b0\uc800 \uc2a4\uc640\uc774\ud504\uac00 \ucc28\ub2e8\ub418\ub3c4\ub85d \ud588\uc2b5\ub2c8\ub2e4."],n),!1,!1,"\ud50c\ub7ec\ud130\uc758 \uc2a4\ud06c\ub864: \ud574\uacb0",o)],f),!1,o)
